import React, {Component} from "react";
import Map from 'pigeon-maps';
import Marker from 'pigeon-marker';
import Overlay from 'pigeon-overlay';
import Navbar from "../Components/Navbar";


class PigeonMaps extends Component{


    pixelToLatLng(pixel, center, zoom) {
        console.log(pixel)
        console.log(center)
        console.log(zoom)
    }

    onClick(event, latLng, pixel) {
       console.log(event)
       console.log(latLng)
       console.log(latLng)
    }


    render() {
        return(
            <div>
                <Navbar />
                <button onClick={this.pixelToLatLng}>Click me</button>
                <Map center={[50.879, 4.6997]} zoom={12} width={600} height={400}>
                <Marker anchor={[50.874, 4.6947]} payload={1} onClick={({ event, anchor, payload }) => {
                        console.log(anchor);
                }} />

                <Overlay anchor={[50.879, 4.6997]} offset={[120, 79]}>
                </Overlay>
                </Map>
            </div>
        )
    }
}

export default PigeonMaps;
